import React from 'react'
import ReactDOM from 'react-dom/client'
import { BrowserRouter, Navigate, Route, Routes } from 'react-router-dom'
import App from './App'
import Welcome from './routes/welcome'
import Login from './routes/login'
import Register from './routes/register'
import NotFound from './routes/NotFound'
import EditProfile from './routes/EditProfile'
const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
)

export interface ProtectedRouteProps {
  isAuthenticated: boolean
  authenticationPath: string
  outlet: JSX.Element
}

export default function ProtectedRoute ({ isAuthenticated, authenticationPath, outlet }: ProtectedRouteProps): JSX.Element {
  if (isAuthenticated) {
    return outlet
  } else {
    return <Navigate to={{ pathname: authenticationPath }} />
  }
};

const defaultProtectedRouteProps: Omit<ProtectedRouteProps, 'outlet'> = {
  isAuthenticated: true,
  authenticationPath: '/login'
}

root.render(
  <React.StrictMode>
      <BrowserRouter>
          <Routes>
              <Route path="/" element={<App />}>
                <Route path="/" element={<Welcome />} />
                <Route path="login" element={<Login />} />
                <Route path="register" element={<Register />} />
                <Route path='edit-profile' element={<ProtectedRoute {...defaultProtectedRouteProps} outlet={<EditProfile />} />} />
                <Route path='*' element={<NotFound />} />
              </Route>
          </Routes>
      </BrowserRouter>
  </React.StrictMode>
)
